import React, { useState } from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom'; // react-router-dom import edildi
import RegisterPage from './RegisterPage';
import LoginPage from './LoginPage';
import HomePage from './HomePage';
import About from './About';
import Contact from './Contact';
import UserPanel from './UserPanel';

const App = () => {
  const [user, setUser] = useState(null); // Kullanıcı bilgisi

  const handleLoginSuccess = (userData) => {
    setUser(userData); // Kullanıcıyı ayarlıyoruz
  };

  return (
    <Router>
      <div className="page-container">
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
          <a className="navbar-brand mx-auto" href="#home">CRM Sistemi</a>
          <div className="collapse navbar-collapse">
            <ul className="navbar-nav ml-auto mx-auto">
              <li className="nav-item">
                <Link className="nav-link" to="/home">Ana Sayfa</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/about">Hakkımızda</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/contact">İletişim</Link>
              </li>
              {!user ? (
                <>
                  <li className="nav-item">
                    <Link className="nav-link" to="/login">Giriş Yap</Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to="/register">Kayıt Ol</Link>
                  </li>
                </>
              ) : (
                <li className="nav-item">
                  <Link className="nav-link" to="/userpanel">Kullanıcı Paneli</Link>
                </li>
              )}
            </ul>
          </div>
        </nav>

        <div className="content">
          <Routes>
            <Route path="/home" element={<HomePage />} />
            <Route path="/about" element={<About />} />
            <Route path="/contact" element={<Contact />} />
            {!user ? (
              <>
                <Route path="/login" element={<LoginPage setUser={handleLoginSuccess} />} />
                <Route path="/register" element={<RegisterPage />} />
              </>
            ) : (
              <Route path="/userpanel" element={<UserPanel user={user} />} />
            )}
          </Routes>
        </div>

        <footer className="footer bg-dark">
          <p className="text-center text-white">&copy; 2025 CRM Support. Tüm hakları saklıdır.</p>
        </footer>
      </div>
    </Router>
  );
};

export default App;
